[{"location":"modules/constants.html#Constants-1","page":"Constants","title":"Constants","text":"","category":"section"},{"location":"modules/constants.html#","page":"Constants","title":"Constants","text":"DocTestSetup = quote\n    using AstroBase\nend","category":"page"},{"location":"modules/constants.html#","page":"Constants","title":"Constants","text":"Modules = [AstroBase.Constants]\nPrivate = false","category":"page"},{"location":"modules/constants.html#","page":"Constants","title":"Constants","text":"DocTestSetup = nothing","category":"page"},{"location":"modules/coords.html#Coordinates-1","page":"Coordinates","title":"Coordinates","text":"","category":"section"},{"location":"modules/coords.html#","page":"Coordinates","title":"Coordinates","text":"DocTestSetup = quote\n    using AstroBase\nend","category":"page"},{"location":"modules/coords.html#","page":"Coordinates","title":"Coordinates","text":"Modules = [AstroBase.Coords]\nPrivate = false","category":"page"},{"location":"modules/coords.html#","page":"Coordinates","title":"Coordinates","text":"DocTestSetup = nothing","category":"page"},{"location":"modules/interfaces.html#Interfaces-1","page":"Interfaces","title":"Interfaces","text":"","category":"section"},{"location":"modules/interfaces.html#","page":"Interfaces","title":"Interfaces","text":"DocTestSetup = quote\n    using AstroBase\nend","category":"page"},{"location":"modules/interfaces.html#","page":"Interfaces","title":"Interfaces","text":"Modules = [AstroBase.Interfaces]\nPrivate = false","category":"page"},{"location":"modules/interfaces.html#","page":"Interfaces","title":"Interfaces","text":"DocTestSetup = nothing","category":"page"},{"location":"modules/earth_attitude.html#Earth-Attitude-1","page":"Earth Attitude","title":"Earth Attitude","text":"","category":"section"},{"location":"modules/earth_attitude.html#","page":"Earth Attitude","title":"Earth Attitude","text":"DocTestSetup = quote\n    using AstroBase\nend","category":"page"},{"location":"modules/earth_attitude.html#","page":"Earth Attitude","title":"Earth Attitude","text":"Modules = [AstroBase.EarthAttitude]\nPrivate = false","category":"page"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.iau1980","page":"Earth Attitude","title":"AstroBase.EarthAttitude.iau1980","text":"`iau1980`\n\nThe singleton instance of type IAU1980, representing the IAU 1980 family of models.\n\n\n\n\n\n","category":"constant"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.iau2000","page":"Earth Attitude","title":"AstroBase.EarthAttitude.iau2000","text":"`iau2000`\n\nThe singleton instance of type IAU2000, representing the IAU 2000 family of models.\n\n\n\n\n\n","category":"constant"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.iau2000a","page":"Earth Attitude","title":"AstroBase.EarthAttitude.iau2000a","text":"`iau2000a`\n\nThe singleton instance of type IAU2000A, representing the IAU 2000A family of models.\n\n\n\n\n\n","category":"constant"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.iau2000b","page":"Earth Attitude","title":"AstroBase.EarthAttitude.iau2000b","text":"`iau2000b`\n\nThe singleton instance of type IAU2000B, representing the IAU 2000B family of models.\n\n\n\n\n\n","category":"constant"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.iau2006","page":"Earth Attitude","title":"AstroBase.EarthAttitude.iau2006","text":"`iau2006`\n\nThe singleton instance of type IAU2006, representing the IAU 2006 family of models.\n\n\n\n\n\n","category":"constant"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.c2tpe-NTuple{8,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.c2tpe","text":"c2tpe(tta, ttb, uta, utb, dpsi, deps, xp, yp)\n\nReturns the celestial to terrestrial matrix given two, 2 part Julian date (UT1, TT), the nutation and coordinates of the pole(radians).\n\nExample\n\njulia> c2tpe(2.4579405e6, 0.0, 2.4579405e6, -0.0007966009351851851, 0.1, 0.3, 0.5, 0.7)\n3×3 Rotations.RotMatrix{3,Float64,9}:\n  0.253143   0.777796  0.575284\n -0.676266  -0.28296   0.680146\n  0.691797  -0.561219  0.454367\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.celestial_to_intermediate-Tuple{Any,Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.celestial_to_intermediate","text":"celestial_to_intermediate(x, y, s)\n\nReturns celestial to intermediate-frame-of-date transformation matrix given the Celestial Intermediate Pole location (x, y and the CIO locator s).\n\nExample\n\njulia> celestial_to_intermediate(0.2, 0.2, 0.1)\n3×3 RotZYZ{Float64}(0.785398, 0.286757, -0.885398):\n  0.976728   0.0774803  0.2\n -0.11811    0.972651   0.2\n -0.179034  -0.218968   0.959166\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.celestial_to_intermediate_frame_of_date-NTuple{4,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.celestial_to_intermediate_frame_of_date","text":"celestial_to_intermediate_frame_of_date(jd1, jd2, x, y)\n\nReturns celestial to intermediate-frame-of-date matrix for a given 2 part Julian Date.\n\nExample\n\njulia> celestial_to_intermediate_frame_of_date(2.4578265e6, 0.30434616919175345, 0.2, 0.3)\n3×3 Rotations.RotZYZ{Float64}(0.982794, 0.368863, -0.952794):\n  0.977932    -0.0604048  0.2\n -0.00243134   0.953936   0.3\n -0.208909    -0.293866   0.932738\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.celestial_to_intermediate_matrix-Tuple{Any,Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.celestial_to_intermediate_matrix","text":"celestial_to_intermediate_matrix(jd1, jd2, rbpn)\n\nReturns celestial-to-intermediate matrix for given 2 part Julian date and celestial-to-true matrix.\n\nExample\n\njulia> celestial_to_intermediate_matrix(2.4578265e6, 0.30434616919175345, rand(3,3))\n3×3 Rotations.RotZYZ{Float64}(0.921674, 1.10597, -0.729284):\n  0.732866  -0.413437  0.54035\n -0.13652    0.688686  0.712092\n -0.666536  -0.595636  0.448272\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.celestial_to_intermediate_matrix_a00-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.celestial_to_intermediate_matrix_a00","text":"celestial_to_intermediate_matrix_a00(jd1, jd2)\n\nReturns celestial-to-intermediate matrix for a given 2 part Julian date (TT).\n\nExample\n\njulia> celestial_to_intermediate_matrix_a00(2.4578265e6, 0.30434616919175345)\n3×3 Rotations.RotZYZ{Float64}(-0.0240766, 0.00165637, 0.0240765):\n  0.999999    6.21979e-8   0.00165589\n  3.83181e-9  1.0         -3.98758e-5\n -0.00165589  3.98757e-5   0.999999\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.celestial_to_intermediate_matrix_b00-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.celestial_to_intermediate_matrix_b00","text":"celestial_to_intermediate_matrix_b00(jd1, jd2)\n\nReturns celestial-to-intermediate matrix for a given 2 part Julian date (TT).\n\nExample\n\njulia> celestial_to_intermediate_matrix_b00(2.4578265e6, 0.30434616919175345)\n3×3 Rotations.RotZYZ{Float64}(-0.0240766, 0.00165637, 0.0240765):\n0.999999    6.21979e-8   0.00165589\n3.83181e-9  1.0         -3.98758e-5\n-0.00165589  3.98757e-5   0.999999\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.celestial_to_terrestrial_a00-NTuple{6,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.celestial_to_terrestrial_a00","text":"celestial_to_terrestrial_a00(tta, ttb, uta, utb, xp, yp)\n\nReturns celestial to terrestrial matrix given two, 2 part Julian dates (UT1, TT) and coordinates of the pole.\n\nExample\n\njulia> celestial_to_terrestrial_a00(2.4579405e6, 0.0, 2.4579405e6, -0.0007966009351851851, 0.1, 0.3)\n3×3 Rotations.RotMatrix{3,Float64,9}:\n  0.235088    0.934797  0.266247\n -0.966879    0.196899  0.162409\n  0.0993959  -0.295609  0.950124\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.celestial_to_terrestrial_b00-NTuple{6,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.celestial_to_terrestrial_b00","text":"celestial_to_terrestrial_b00(tta, ttb, uta, utb, xp, yp)\n\nReturns celestial to terrestrial matrix given two, 2 part Julian dates (UT1, TT) and coordinates of the pole.\n\nExample\n\njulia> celestial_to_terrestrial_b00(2.4579405e6, 0.0, 2.4579405e6, -0.0007966009351851851, 0.1, 0.3)\n3×3 Rotations.RotMatrix{3,Float64,9}:\n  0.235088    0.934797  0.266247\n -0.966879    0.196899  0.162409\n  0.0993959  -0.295609  0.950124\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.celestial_to_terrestrial_matrix-NTuple{8,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.celestial_to_terrestrial_matrix","text":"celestial_to_terrestrial_matrix(tta, ttb, uta, utb, x, y, xp, yp)\n\nReturns celestial to terrestrial matrix for given two, 2 part Julian dates (UT1, TT) and CIP coordinates.\n\nExample\n\njulia> celestial_to_terrestrial_matrix(2.4579405e6, 0.0, 2.4579405e6, -0.0007966009351851851, 0.1, 0.3, 0.5, 0.7)\n3×3 Rotations.RotMatrix{3,Float64,9}:\n  0.279858   0.75876   0.588186\n -0.66989   -0.284531  0.685777\n  0.687697  -0.58594   0.428658\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.cip_coords-Tuple{Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.cip_coords","text":"cip_coords(rbpn)\n\nExtract from the bias-precession-nutation matrix the X,Y coordinates of the Celestial Intermediate Pole.\n\nReferences\n\nERFA\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.earth_rotation_angle-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.earth_rotation_angle","text":"earth_rotation_angle(jd1, jd2)\n\nReturn Earth rotation angle (radians) for a given UT1 2-part Julian Date (jd1, jd2).\n\nExample\n\njulia> earth_rotation_angle(2.4578265e6, 0.30434616919175345)\n4.912208135094597\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.equation_of_equinoxes_00-NTuple{4,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.equation_of_equinoxes_00","text":"equation_of_equinoxes_00(jd1, jd2, epsa, dpsi)\n\nReturn equation of equinoxes for given 2 part Julian date (TT), mean obliquity and nutation in longitude.\n\nExample\n\njulia> equation_of_equinoxes_00(2.4578265e6, 0.30440190993249416, 1.5, 1.7)\n0.12025324854189404\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.equation_of_equinoxes_94-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.equation_of_equinoxes_94","text":"equation_of_equinoxes_94(jd1, jd2)\n\nReturns equation of equinoxes for a given 2 part Julian date (TT). (IAU 1994 model)\n\nExample\n\njulia> equation_of_equinoxes_94(2.4578265e6, 0.30434616919175345)\n-3.446039061100115e-5\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.equation_of_equinoxes_a00-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.equation_of_equinoxes_a00","text":"equation_of_equinoxes_a00(jd1, jd2)\n\nReturns equation of equinoxes for a given 2 part Julian date(TT).\n\nExample\n\njulia> equation_of_equinoxes_a00(2.4578265e6, 0.30434616919175345)\n-3.4482238309105874e-5\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.equation_of_equinoxes_a06-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.equation_of_equinoxes_a06","text":"equation_of_equinoxes_a06(jd1, jd2)\n\nReturns equation of equinoxes for a given 2 part Julian date (TT).\n\nExample\n\njulia> equation_of_equinoxes_a06(2.4578265e6, 0.30434616919175345)\n-3.448290610741367e-5\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.equation_of_equinoxes_b00-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.equation_of_equinoxes_b00","text":"equation_of_equinoxes_b00(jd1, jd2)\n\nReturns equation of equinoxes for a given 2 part Julian date(TT).\n\nExample\n\njulia> equation_of_equinoxes_b00(2.4578265e6, 0.30434616919175345)\n-3.4482238309105874e-5\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.equation_of_equinoxes_complementary_terms-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.equation_of_equinoxes_complementary_terms","text":"equation_of_equinoxes_complementary_terms(jd1, jd2)\n\nReturns complementary terms for a given 2 part Julian date (TT).\n\nExample\n\njulia> equationofequinoxescomplementaryterms(2.4578265e6, 0.30434616919175345) 5.706799075288604e-9 ```\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.equation_of_origins-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.equation_of_origins","text":"equation_of_origins(rnpb, s)\n\nReturns the equation of origins(radians) for given nutation-bias-precession matrix and the CIO locator.\n\nExample\n\njldoctest equation_of_origins(rand(3,3), 0.2) 1.7738370040531068\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.fukushima_williams_matrix-NTuple{4,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.fukushima_williams_matrix","text":"fukushima_williams_matrix(gamb, phib, psi, eps)\n\nReturns  obliquity of the ecliptic (radians) for a given Julian 2 part date (TT).\n\nExample\n\njulia> fukushima_williams_matrix(0.2,0.3,0.5,0.6)\n3×3 RotMatrix{Float64}:\n  0.951082   0.21718   0.219716\n -0.274534   0.920305  0.278692\n -0.14168   -0.325378  0.93491\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.general_precession_in_longitude-Tuple{Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.general_precession_in_longitude","text":"general_precession_in_longitude(t)\n\nReturns general accumulated precession in longitude for Julian centuries since J2000.0 in TDB.\n\nExample\n\njulia> general_precession_in_longitude(23.0)\n0.56362992539\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.greenwich_apparent_sidereal_time06-NTuple{5,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.greenwich_apparent_sidereal_time06","text":"greenwich_mean_sidereal_time06(uta, utb, tta, ttb, rnpb)\n\nReturns Greenwich mean sidereal time(radians) for given two, 2 part Julian dates (TT and UT1).\n\nExample\n\njulia> gst06(2.4579405e6, 0.0, 2.4579405e6, -0.0007966009351851851, rand(3,3))\n3.738379033673736\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.greenwich_apparent_sidereal_time94-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.greenwich_apparent_sidereal_time94","text":"greenwich_apparent_sidereal_time94(uta, utb)\n\nReturns greenwich appart sidereal time for given 2 part Julian date (UT1).\n\nExample\n\njulia> greenwich_apparent_sidereal_time94(2.4578265e6, 0.30434616919175345)\n4.9160197844443445\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.greenwich_apparent_sidereal_time_a00-NTuple{4,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.greenwich_apparent_sidereal_time_a00","text":"greenwich_apparent_sidereal_time_a00(uta, utb, tta, ttb)\n\nReturns Greenwich apparent sidereal time for given two, 2 part Julian date. (UT1, TT)\n\nExample\n\njulia> greenwich_apparent_sidereal_time_a00(2.4579405e6, 0.0, 2.4579405e6, -0.0007966009351851851)\n4.959632360790386\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.greenwich_apparent_sidereal_time_a06-NTuple{4,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.greenwich_apparent_sidereal_time_a06","text":"greenwich_apparent_sidereal_time_a06(uta, utb, tta, ttb)\n\nReturns Greenwich apparent sidereal time for given two, 2 part Julian dates. (UT1, TT)\n\nExample\n\njulia> greenwich_apparent_sidereal_time_a06(2.4579405e6, 0.0, 2.4579405e6, -0.0007966009351851851)\n4.959632359298287\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.greenwich_apparent_sidereal_time_b00-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.greenwich_apparent_sidereal_time_b00","text":"greenwich_apparent_sidereal_time_b00(uta, utb, tta, ttb)\n\nReturns Greenwich apparent sidereal time for given two, 2 part Julian date. (UT1, TT)\n\nExample\n\njulia> greenwich_apparent_sidereal_time_b00(2.4579405e6, 0.0, 2.4579405e6, -0.0007966009351851851)\n4.95963236232993\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.greenwich_mean_sidereal_time00-NTuple{4,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.greenwich_mean_sidereal_time00","text":"greenwich_mean_sidereal_time00(ut1, ut2, tt1, tt2)\n\nReturns Greenwich mean sidereal time(radians) for given two, 2 part Julian dates (TT and UT1). (consistent with IAU 2000 precession)\n\nExample\n\njulia> greenwich_mean_sidereal_time00(2.4579405e6, 0.0, 2.4579405e6, -0.0007966009351851851)\n4.9596733720586075\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.greenwich_mean_sidereal_time06-NTuple{4,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.greenwich_mean_sidereal_time06","text":"greenwich_mean_sidereal_time06(ut1, ut2, tt1, tt2)\n\nReturns Greenwich mean sidereal time(radians) for given two, 2 part Julian dates (TT and UT1). (consistent with IAU 2006 precession)\n\nExample\n\njulia> greenwich_mean_sidereal_time06(2.4579405e6, 0.0, 2.4579405e6, -0.0007966009351851851)\n4.959673370568533\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.greenwich_mean_sidereal_time82-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.greenwich_mean_sidereal_time82","text":"greenwich_mean_sidereal_time82(jd1, jd2)\n\nReturns Greenwich mean sidereal time(radians) for given 2 part Julian dates (UT1). (consistent with IAU 1982 model)\n\nExample\n\njulia> greenwich_mean_sidereal_time82(2.4578265e6, 0.30434616919175345)\n4.916054244834956\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.greenwich_mean_sidereal_time_a06-NTuple{4,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.greenwich_mean_sidereal_time_a06","text":"greenwich_mean_sidereal_time_a06(uta, utb, tta, ttb, rnpb)\n\nReturns greenwich apparent sidereal time for given two, 2 part Julian dates (UT1, TT).\n\nExample\n\n\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.mean_elongation-Tuple{Luna,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.mean_elongation","text":"mean_elongation(::Luna, t)\n\nReturns mean elongation of the Moon from the Sun for Julian centuries since J2000.0 in TDB.\n\nExample\n\njulia> mean_elongation(::Luna, 23.0)\n2.8012040574296484\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.mean_longitude-Tuple{Earth,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.mean_longitude","text":"mean_longitude(::Earth, t)\n\nReturns mean longitude of Earth for Julian centuries since J2000.0 in TDB.\n\nExample\n\njulia> mean_longitude(earth, 23.0)\n1.501718780251826\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.mean_longitude-Tuple{Jupiter,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.mean_longitude","text":"mean_longitude(::Jupiter, t)\n\nReturns mean longitude of Jupiter for Julian centuries since J2000.0 in TDB.\n\nExample\n\njulia> mean_longitude(jupiter, 23.0)\n6.233996285639864\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.mean_longitude-Tuple{Mars,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.mean_longitude","text":"mean_longitude(::Mars, t)\n\nReturns mean longitude of Mars for Julian centuries since J2000.0 in TDB.\n\nExample\n\njulia> mean_longitude(mars, 23.0)\n5.276431642365657\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.mean_longitude-Tuple{Mercury,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.mean_longitude","text":"mean_longitude(::Mercury, t)\n\nReturns mean longitude of Mercury for Julian centuries since J2000.0 in TDB.\n\nExample\n\njulia> mean_longitude(mercury, 23.0)\n2.160150897150834\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.mean_longitude-Tuple{Neptune,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.mean_longitude","text":"mean_longitude(::Neptune, t)\n\nReturns mean longitude of Neptune for Julian centuries since J2000.0 in TDB.\n\nExample\n\njulia> mean_longitude(neptune, 23.0)\n5.053273953885775\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.mean_longitude-Tuple{Saturn,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.mean_longitude","text":"mean_longitude(::Saturn, t)\n\nReturns mean longitude of Saturn for Julian centuries since J2000.0 in TDB.\n\nExample\n\njulia> mean_longitude(saturn, 23.0)\n1.3735042049922535\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.mean_longitude-Tuple{Uranus,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.mean_longitude","text":"mean_longitude(::Uranus, t)\n\nReturns mean longitude of Uranus for Julian centuries since J2000.0 in TDB.\n\nExample\n\njulia> mean_longitude(uranus, 23.0)\n1.5497819750715893\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.mean_longitude-Tuple{Venus,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.mean_longitude","text":"mean_longitude(::Venus, t)\n\nReturns mean longitude of Venus for Julian centuries since J2000.0 in TDB.\n\nExample\n\njulia> mean_longitude(venus, 23.0)\n0.9030394378238363\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.mean_longitude_ascending_node-Tuple{Luna,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.mean_longitude_ascending_node","text":"mean_longitude_ascending_node(::Luna, t)\n\nReturn fundamental argument for Julian centuries since J2000.0 in TDB.\n\nExample\n\njulia> mean_longitude_ascending_node(luna, 23.0)\n4.904897783682109\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.mean_longitude_minus_lan-Tuple{Luna,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.mean_longitude_minus_lan","text":"mean_longitude_minus_lan(::Luna, t)\n\nReturns mean longitude of the Moon minus mean longitude of the ascending node for Julian centuries since J2000.0 in TDB.\n\nExample\n\njulia> mean_longitude_minus_lan(23.0)\n3.103138156410118\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.nutation","page":"Earth Attitude","title":"AstroBase.EarthAttitude.nutation","text":"nutation(model, ep)\n\nReturn the nutation components for a given epoch and model.\n\nArguments\n\nmodel: IAU model, one of: iau1980, iau2000a, iau2000b, iau2006\nep: An epoch\n\nOutput\n\nδψ: Nutation in longitude (radians)\nδϵ: Nutation in obliquity (radians)\n\nExample\n\njulia> ep = TTEpoch(2020, 1, 1)\n2020-01-01T00:00:00.000 TT\n\njulia> nutation(iau2006, ep)\n(-7.996558232098883e-5, -8.25141288270117e-6)\n\nReferences\n\nSOFA\n\n\n\n\n\n","category":"function"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.nutation_matrix80-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.nutation_matrix80","text":"nutation_matrix80(jd1, jd2)\n\nReturns nutation matrix for a given 2 part Julian date (TDB).\n\nExample\n\njldoctest julia> nutation_matrix80(2.4578265e6, 0.30434616919175345) 3×3 Rotations.RotXZX{Float64}(0.409054, 3.75653e-5, -0.409017):  1.0         -3.44666e-5  -1.494e-5  3.44661e-5   1.0         -3.66564e-5  1.49413e-5   3.66559e-5   1.0\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.nutation_matrix_day-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.nutation_matrix_day","text":"nutation_matrix_day(jd1,jd2)\n\nReturns nutation matrix for a given 2 part Julian date(TT).\n\nExample\n\njulia> precession_nutation_b00(2.4578265e6, 0.30434616919175345)[3][5]\n3×3 Rotations.RotXZX{Float64}(0.409054, 3.75891e-5, -0.409017):\n 1.0         -3.44885e-5  -1.49495e-5\n 3.44879e-5   1.0         -3.66577e-5\n 1.49508e-5   3.66572e-5   1.0\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.nutation_matrix_day_a00-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.nutation_matrix_day_a00","text":"nutation_matrix_day_a00(jd1, jd2)\n\nReturns nutation matrix for a given 2 part Julian date(TT).\n\nExample\n\njulia> precession_nutation_a00(2.4578265e6, 0.30434616919175345)[3][5]\n3×3 Rotations.RotXZX{Float64}(0.409054, 3.75891e-5, -0.409017):\n 1.0         -3.44885e-5  -1.49495e-5\n 3.44879e-5   1.0         -3.66577e-5\n 1.49508e-5   3.66572e-5   1.0\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.nutation_matrix_day_b00-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.nutation_matrix_day_b00","text":"nutation_matrix_day_b00(jd1, jd2)\n\nReturns nutation matrix for a given 2 part Julian date(TT).\n\nExample\n\njulia> precession_nutation_b00(2.4578265e6, 0.30434616919175345)[3][5]\n3×3 Rotations.RotXZX{Float64}(0.409054, 3.75891e-5, -0.409017):\n 1.0         -3.44885e-5  -1.49495e-5\n 3.44879e-5   1.0         -3.66577e-5\n 1.49508e-5   3.66572e-5   1.0\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.obliquity","page":"Earth Attitude","title":"AstroBase.EarthAttitude.obliquity","text":"obliquity(model, ep)\n\nReturn the mean obliquity of the ecliptic for a given epoch and model.\n\nArguments\n\nmodel: IAU model, one of: iau1980, iau2006\nep: An epoch\n\nOutput\n\nReturns the angle between the ecliptic and mean equator of date in radians.\n\nExample\n\njulia> ep = TTEpoch(2020, 1, 1)\n2020-01-01T00:00:00.000 TT\n\njulia> obliquity(iau2006, ep)\n0.40904718953841473\n\nReferences\n\nSOFA\n\n\n\n\n\n","category":"function"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.polar_motion-Tuple{Any,Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.polar_motion","text":"polar_motion(rx, ry, sp)\n\nForm the matrix of polar motion for coordinates of the pole (radians).\n\nExample\n\njulia> polar_motion(20, 30, 50)\n3×3 RotZYX{Float64}(50.0, -20.0, -30.0):\n  0.393785  -0.829946  -0.395124\n -0.10707    0.385514  -0.916469\n  0.912945   0.403198   0.0629472\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.precession_fukushima_williams06-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.precession_fukushima_williams06","text":"precession_fukushima_williams06(jd1, jd2)\n\nReturns fukushima angles(radians) for a given 2 part Julian date (TT).\n\nExample\n\njulia> precession_fukushima_williams06(2.4578265e6, 0.30434616919175345)\n(8.616170933989655e-6, 0.4090536093366178, 0.004201176043952816, 0.409053547482157)\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.precession_nutation_a00-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.precession_nutation_a00","text":"precession_nutation_a00(jd1, jd2, dpsi, deps)\n\nReturns     dpsi, deps     epsa     rb     rp     rbp     rn     rbpn for a given 2 part Julian date (TT) and nutations.\n\nExample\n\njulia> precession_nutation_a00(2.4578265e6, 0.30434616919175345)\n(-3.758986507815969e-5, -3.6659048454874034e-5, (0.40905374831590824, [1.0 7.07828e-8 -8.05622e-8; -7.07828e-8 1.0 -3.30604e-8; 8.05622e-8 3.30604e-8 1.0], [0.999991 0.00384587 0.00167106; -0.00384587 0.999993 -3.24146e-6; -0.00167106 -3.18524e-6 0.999999], [0.999991 0.00384594 0.00167098; -0.00384594 0.999993 -3.27421e-6; -0.00167098 -3.1523e-6 0.999999], [1.0 -3.44892e-5 -1.49498e-5; 3.44886e-5 1.0 -3.66593e-5; 1.4951e-5 3.66588e-5 1.0], [0.999991 0.00381152 0.00165589; -0.00381145 0.999993 -3.98758e-5; -0.00165603 3.35641e-5 0.999999]))\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.precession_nutation_b00-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.precession_nutation_b00","text":"precession_nutation_b00(jd1, jd2, dpsi, deps)\n\nReturns     dpsi, deps     epsa     rb     rp     rbp     rn     rbpn for a given 2 part Julian date (TT) and nutations.\n\nExample\n\njulia> precession_nutation_b00(2.4578265e6, 0.30434616919175345)\n(-3.758913944197044e-5, -3.665743003046017e-5, (0.40905374831590824, [1.0 7.07828e-8 -8.05622e-8; -7.07828e-8 1.0 -3.30604e-8; 8.05622e-8 3.30604e-8 1.0], [0.999991 0.00384587 0.00167106; -0.00384587 0.999993 -3.24146e-6; -0.00167106 -3.18524e-6 0.999999], [0.999991 0.00384594 0.00167098; -0.00384594 0.999993 -3.27421e-6; -0.00167098 -3.1523e-6 0.999999], [1.0 -3.44885e-5 -1.49495e-5; 3.44879e-5 1.0 -3.66577e-5; 1.49508e-5 3.66572e-5 1.0], [0.999991 0.00381152 0.00165589; -0.00381146 0.999993 -3.98741e-5; -0.00165603 3.35625e-5 0.999999]))\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.precession_nutation_matrix_a00-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.precession_nutation_matrix_a00","text":"precession_nutation_matrix_a00(jd1, jd2)\n\nReturns classical NBP matrix for a given 2 part Julian date(TT)\n\nExample\n\njulia> precession_nutation_matrix_a00(2.4578265e6, 0.30434616919175345)\n3×3 Rotations.RotMatrix{3,Float64,9}:\n  0.999991    0.00381152   0.00165589\n -0.00381145  0.999993    -3.98758e-5\n -0.00165603  3.35641e-5   0.999999\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.precession_nutation_matrix_a06-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.precession_nutation_matrix_a06","text":"precession_nutation_matrix_a06(jd1, jd2)\n\nReturns classical NBP matrix for a given 2 part Julian date(TT)\n\nExample\n\njulia> precession_nutation_matrix_a06(2.4578265e6, 0.30434616919175345)\n3×3 Rotations.RotMatrix{3,Float64,9}:\n  0.999991    0.00381151   0.00165589\n -0.00381145  0.999993    -3.98694e-5\n -0.00165602  3.35578e-5   0.999999\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.precession_nutation_matrix_b00-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.precession_nutation_matrix_b00","text":"precession_nutation_matrix_b00(jd1, jd2)\n\nReturns classical NBP matrix for a given 2 part Julian date(TT)\n\nExample\n\njulia> precession_nutation_matrix_b00(2.4578265e6, 0.30434616919175345)\n3×3 Rotations.RotMatrix{3,Float64,9}:\n  0.999991    0.00381152   0.00165589\n -0.00381146  0.999993    -3.98741e-5\n -0.00165603  3.35625e-5   0.999999\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.precession_rate_part_of_nutation-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.precession_rate_part_of_nutation","text":"precession_rate_part_of_nutation(jd1, jd2)\n\nReturns precession corrections for a given 2 part Julian date (TT).\n\nExample\n\njulia> precession_rate_part_of_nutation(2400000.5, 53736)\n-0.8716465172668347629e-7, -0.7342018386722813087e-8\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.s00","page":"Earth Attitude","title":"AstroBase.EarthAttitude.s00","text":"s00(jd1, jd2, x, y)\n\nReturns Celestial Intermediate Origin(CIO) for a given 2-part Julian date (jd1, jd2) with CIP coordinates (x, y). Compatible with IAU-2000 precession-nutation.\n\nExample\n\njulia> AstroBase.s00(2.4578265e6, 0.30434616919175345, 20, 50)\n-500.00000000383193\n\n\n\n\n\n","category":"function"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.s00a-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.s00a","text":"s00a(jd1, jd2)\n\nReturns the CIO locator (radians) for a given 2 part Julian date (TT).\n\nExample\n\njulia> s00a(2.4578265e6, 0.30434616919175345)\n2.9183401976144617e-8\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.s00b-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.s00b","text":"s00b(jd1, jd2)\n\nReturns the CIO locator (radians) for a given 2 part Julian date (TT).\n\nExample\n\njulia> s00b(2.4578265e6, 0.30434616919175345)\n2.9182068810695328e-8\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.s06","page":"Earth Attitude","title":"AstroBase.EarthAttitude.s06","text":"s06(jd1, jd2, x, y)\n\nReturns Celestial Intermediate Origin(CIO) for a given 2-part Julian date (jd1, jd2) with CIP coordinates (x, y)\n\nExample\n\njulia> AstroBase.s06(2.4578265e6, 0.30434616919175345, 20, 50) -500.00000000383193 ```\n\n\n\n\n\n","category":"function"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.s06a-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.s06a","text":"s06a(jd1, jd2)\n\nReturns the CIO locator for a given 2 part Julian date (TT).\n\nExample\n\njulia> s06a(2.4578265e6, 0.30434616919175345)\n2.917767075719633e-8\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.tio_locator-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.tio_locator","text":"tio_locator(jd1, jd2)\n\nReturns TIO locator s' position for a given TT 2-part Julian date (jd1, jd2).\n\nExample\n\njulia> AstroBase.tio_locator(2.4578265e6, 0.30434616919175345)\n-3.9189245827947945e-11\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.xy06-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.xy06","text":"xy06(jd1, jd2)\n\nReturns X, Y coordinates of celestial intermediate pole for a given 2-part Julian date in TT.\n\nExample\n\njulia> xy06(2.4578265e6, 0.30440190993249416)\n(0.0016558850230577835, -3.986943362456243e-5)\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.xys00a-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.xys00a","text":"xys00a(jd1, jd2)\n\nReturns Celestial intermediate pole (x, y) and the CIO locator for a given 2 part Julian date. (TT)\n\nExample\n\njulia> xys00a(2.4578265e6, 0.30434616919175345)\n(0.001655885227051451, -3.987617878202287e-5, 2.9183401976144617e-8)\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#AstroBase.EarthAttitude.xys00b-Tuple{Any,Any}","page":"Earth Attitude","title":"AstroBase.EarthAttitude.xys00b","text":"xys00a(jd1, jd2)\n\nReturns Celestial intermediate pole (x, y) and the CIO locator for a given 2 part Julian date. (TT)\n\nExample\n\njulia> xys00b(2.4578265e6, 0.30434616919175345)\n(0.001655885521808701, -3.987456146931851e-5, 2.9182068810695328e-8)\n\n\n\n\n\n","category":"method"},{"location":"modules/earth_attitude.html#","page":"Earth Attitude","title":"Earth Attitude","text":"DocTestSetup = nothing","category":"page"},{"location":"modules/ephemerides.html#Ephemerides-1","page":"Ephemerides","title":"Ephemerides","text":"","category":"section"},{"location":"modules/ephemerides.html#","page":"Ephemerides","title":"Ephemerides","text":"DocTestSetup = quote\n    using AstroBase\nend","category":"page"},{"location":"modules/ephemerides.html#","page":"Ephemerides","title":"Ephemerides","text":"Modules = [AstroBase.Ephemerides]\nPrivate = false","category":"page"},{"location":"modules/ephemerides.html#","page":"Ephemerides","title":"Ephemerides","text":"DocTestSetup = nothing","category":"page"},{"location":"modules/two_body.html#Two-Body-Problem-1","page":"Two-Body Problem","title":"Two-Body Problem","text":"","category":"section"},{"location":"modules/two_body.html#","page":"Two-Body Problem","title":"Two-Body Problem","text":"DocTestSetup = quote\n    using AstroBase\nend","category":"page"},{"location":"modules/two_body.html#","page":"Two-Body Problem","title":"Two-Body Problem","text":"Modules = [AstroBase.TwoBody]\nPrivate = false","category":"page"},{"location":"modules/two_body.html#AstroBase.TwoBody.transform-NTuple{4,Any}","page":"Two-Body Problem","title":"AstroBase.TwoBody.transform","text":"transform(from, to, a, ecc)\n\nTransform anomaly a from one anomaly type to another for an orbit with eccentricity ecc.\n\nArguments\n\nfrom, to: Anomaly types\ntrue_anomaly\neccentric_anomaly\nmean_anomaly\na: Current value of the anomaly\necc: Eccentricity of the orbit\n\nOutput\n\nReturns the transformed anomaly.\n\nReferences\n\nFarnocchia, Davide, Davide Bracali Cioci, and Andrea Milani.   \"Robust resolution of Kepler’s equation in all eccentricity regimes.\"   Celestial Mechanics and Dynamical Astronomy 116, no. 1 (2013): 21-34.\n\n\n\n\n\n","category":"method"},{"location":"modules/two_body.html#","page":"Two-Body Problem","title":"Two-Body Problem","text":"DocTestSetup = nothing","category":"page"},{"location":"modules/util.html#Utilities-1","page":"Utilities","title":"Utilities","text":"","category":"section"},{"location":"modules/util.html#","page":"Utilities","title":"Utilities","text":"DocTestSetup = quote\n    using AstroBase\nend","category":"page"},{"location":"modules/util.html#","page":"Utilities","title":"Utilities","text":"Modules = [AstroBase.Util]\nPrivate = false","category":"page"},{"location":"modules/util.html#AstroBase.Util.rad2sec-Tuple{Any}","page":"Utilities","title":"AstroBase.Util.rad2sec","text":"rad2sec(rad)\n\nConvert an angle in radians to arcseconds.\n\nExample\n\njulia> rad2sec(0.5235987755982988)\n107999.99999999999\n\n\n\n\n\n","category":"method"},{"location":"modules/util.html#AstroBase.Util.sec2rad-Tuple{Any}","page":"Utilities","title":"AstroBase.Util.sec2rad","text":"sec2rad(sec)\n\nConvert an angle in arcseconds to radians.\n\nExample\n\njulia> sec2rad(3600 * 30)\n0.5235987755982988\n\n\n\n\n\n","category":"method"},{"location":"modules/util.html#AstroBase.Util.spherical_to_cartesian-Tuple{Any,Any}","page":"Utilities","title":"AstroBase.Util.spherical_to_cartesian","text":"sphericaltocartesian(theta, phi)\n\nConvert spherical coordinates to Cartesian.\n\nArguments\n\ntheta: longitude angle in radians\nphi: latitude angle in radians\n\nReturns\n\nx: magnitude of projection on x axis\ny: magnitude of projection on y axis\nz: magnitude of projection on z axis\n\nReferences\n\nERFA\n\n\n\n\n\n","category":"method"},{"location":"modules/util.html#","page":"Utilities","title":"Utilities","text":"DocTestSetup = nothing","category":"page"},{"location":"modules/frames.html#Reference-Frames-1","page":"Reference Frames","title":"Reference Frames","text":"","category":"section"},{"location":"modules/frames.html#","page":"Reference Frames","title":"Reference Frames","text":"DocTestSetup = quote\n    using AstroBase\nend","category":"page"},{"location":"modules/frames.html#","page":"Reference Frames","title":"Reference Frames","text":"Modules = [AstroBase.Frames]\nPrivate = false","category":"page"},{"location":"modules/frames.html#","page":"Reference Frames","title":"Reference Frames","text":"DocTestSetup = nothing","category":"page"},{"location":"index.html#AstroBase.jl-1","page":"Home","title":"AstroBase.jl","text":"","category":"section"},{"location":"modules/bodies.html#Celestial-Bodies-1","page":"Celestial Bodies","title":"Celestial Bodies","text":"","category":"section"},{"location":"modules/bodies.html#","page":"Celestial Bodies","title":"Celestial Bodies","text":"DocTestSetup = quote\n    using AstroBase\nend","category":"page"},{"location":"modules/bodies.html#","page":"Celestial Bodies","title":"Celestial Bodies","text":"Modules = [AstroBase.Bodies]\nPrivate = false","category":"page"},{"location":"modules/bodies.html#","page":"Celestial Bodies","title":"Celestial Bodies","text":"DocTestSetup = nothing","category":"page"}]
